import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header';
import HomePage from './pages/HomePage';
import AboutPage from './pages/AboutPage';
import ContactPage from './pages/ContactPage';
import NoticeboardPage from './pages/noticeboard';
import WritingPage from './pages/writing';
import BaseballGamePage from './pages/BaseballGamePage';
import './styles/App.css';

function App() {
  return (
    <Router>
      <div className="app-container">
        <Header />
        <main className="main-content">
          {/* <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/about" element={<AboutPage />} />
            <Route path="/contact" element={<ContactPage />} />
            <Route path="/noticeboard" element={<NoticeboardPage />} />
            <Route path="/writing" element={<WritingPage />} />
            <Route path="/game" element={<BaseballGamePage />} />
          </Routes> */}
        </main>
        <footer className="footer">
          <div className="footer-content">
            <div className="footer-links">
              <a href="/" className="footer-link">홈</a>
              <a href="/about" className="footer-link">BKO</a>
              <a href="/game" className="footer-link">게임</a>
              <a href="/noticeboard" className="footer-link">게시판</a>
            </div>
            {/* <p className="copyright">
              © 2024 Baseball Game App. All rights reserved.
            </p> */}
          </div>
        </footer>
      </div>
    </Router>
  );
}

export default App;
